import React, {FC, ChangeEvent } from 'react'
// import logo from './images/superAdmin.png';
export default function SignUp() {
  function handleOnClick  () {
    var modal = document.getElementById('id01');
window.onclick = function(event) {
  console.log('The link was clicked.'+ modal + "e" + event.target);
    if (event.target == modal) {
        modal.style.display = "none";
    }
}
  }
  return (
    <div className = 'container'>
    <h2 className= "text-center">Sign Up Form</h2>
    <form action="/action_page.php">
    
    <section>
        <div className="row"> 
        <div className = 'col-sm-5 col-md-6 split'>
        <label><b>Full Name</b></label><br />
        <input type="text" placeholder="Enter Full Name" name="uname" className="mytext" required/><br />
        </div>
            
      <div className = 'col-sm-5 offset-sm-2 col-md-6 offset-md-0 split'>
      <label><b>Email Id</b></label><br />
      <input type="text" placeholder="Enter Email" name="psw" className="mytext" required/><br /><br />
      </div>
      </div>
      <div className="row"> 
      <div className = 'col-sm-5 col-md-6 split'>
      <label><b>Employee ID</b></label><br />
      <input type="text" placeholder="Enter Employee ID" name="psw" required/><br /><br />
      </div>
      
      <div className = 'col-sm-5 offset-sm-2 col-md-6 offset-md-0 split'>
      <label><b>Date of Birth</b></label><br />
      <input type="text" placeholder="Enter DOB" name="psw" required/><br /><br />
      </div>
      </div>
      
      <div className = 'split'>
       <button type="submit">Submit</button><br />
       <input type="checkbox" checked="checked"/> Remember me
      </div>
    </section>
    </form>
    </div>
    )
}
